import React, { Component } from "react";
import { Link } from "react-router-dom";

class Home extends Component {
  state = {};
  render() {
    return (
      <div className="d-flex justify-content-center vh-40">
        <div className="row ">
          <button type="button" class="btn btn-lg btn-outline-primary m-3">
            <Link
              className="nav-item nav-link text-black-50 text-center"
              to="/searchRide"
            >
              Need a Ride
            </Link>
          </button>

          <button type="button" class="btn btn-lg btn-outline-secondary m-3">
            <Link
              className="nav-item nav-link text-black-50 text-center"
              to="/offerRide"
            >
              Offer a Ride
            </Link>
          </button>
        </div>
      </div>
    );
  }
}

export default Home;
